import './../Style/EditShop.css';
import { useParams } from "react-router-dom";
import { useState, useEffect } from 'react';
import {variables} from "../Variables";
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function AppEditShop(){
    const { id } = useParams();
    const [shop, setShop] = useState([]);
    // const [PS_edit_click,PS_edit_setClick] = useState(false);
    // const PS_edit_handleClick = () => PS_edit_setClick(!PS_edit_click);

    useEffect(() => {
        console.log(id)
        fetch(variables.API_URL+"get_shop/"+id, {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setShop(result[0])
            }
        )
    }, []);


    if(shop.id){
        return(
            <div className='EditShop'>
            <div className="form_Edit_Shop">
                <div className='form_Shop'>
                
               
                <form action=''>
                <h2> EDIT SHOP</h2>
                <img src="https://cwdaust.com.au/wpress/wp-content/uploads/2015/04/placeholder-store.png" alt="" />
                <div className="input-frame">
    
                            <input className="ES-input" id="register-FirstName" type="text" name="firstName"
                                placeholder="Shop Name"/>
                            <span className="symbol">
                                <i className="fa-solid fa-user"></i>
                            </span>
                        </div>
                    <div className="search-bar">
                        <div className="search-select">
                            <input type="button" value="Category V" id="select-province" onClick={(e) => {document.getElementsByClassName("province-list")[0].classList.toggle("select-province-toggle")}} />
                            <div className="province-list">
                                <label htmlFor="Eyelashextensions">Eyelash extensions<input type="checkbox" name="Eyelashextensions" id="Eyelashextensions" className="select-item"   /><span className="checkmark"></span></label>
                                <label htmlFor="Hairsalon">Hair salon<input type="checkbox" name="Hairsalon" id="Hairsalon" className="select-item"   /><span className="checkmark"></span></label>
                                <label htmlFor="Spasalons">Spa salons<input type="checkbox" name="Spasalons" id="Spasalons" className="select-item"   /><span className="checkmark"></span></label>
                                <label htmlFor="Nailsalons">Nail salons<input type="checkbox" name="Nailsalons" id="Nailsalons" className="select-item"   /><span className="checkmark"></span></label>
                                <label htmlFor="Beautysalons">Beauty salons<input type="checkbox" name="Beautysalons" id="Beautysalons" className="select-item"  /><span className="checkmark"></span></label>
                            </div>
                        </div>
                    </div>
                    <div className="input-frame">
                            <input className="ES-input" id="register-PhoneNumber" type="tel" name="phonenumber"
                                placeholder="Phone Number" pattern="[0-9]{10}" />
                            <span className="symbol">
                                <i className="fa-solid fa-phone"></i>
                            </span>
                        </div>
                        <div className="input-frame">
                            <input className="ES-input" id="register-address" type="text" name="address"
                                placeholder="Address"/>
                            <span className="symbol">
                                <i className="fa-solid fa-location-dot"></i>
                            </span>
                        </div>
                        <button type="submit" className="ES_button_submit"><i className="fa-solid fa-pen"></i> Edit</button>
                </form>
                </div>
            </div>
        </div>
        );
    }
}

export default AppEditShop;
